$testString = "1,2,3,4,5,6,7";

echo sumNumString($testString);

function sumNumString($numString) {
  $numArray = explode(",", $numString);
  $sum = 0;

  foreach ($numArray as $num) {
    $sum += $num;
  }

  return $sum;
}
```

